function createTable(tableData) {
  var table = document.createElement('table');
  var tableBody = document.createElement('tbody');

  tableData.forEach(function(rowData) {
    var row = document.createElement('tr');

    rowData.forEach(function(cellData) {
      var cell = document.createElement('td');
      cell.appendChild(document.createTextNode(cellData));
      row.appendChild(cell);
    });

    tableBody.appendChild(row);
  });

  table.appendChild(tableBody);
  document.body.appendChild(table);
}

function setSqColors(arr) {
	
	for (i = 0; i < 60; i++) {
		document.getElementById("sq" + i).style.opacity = (1.5 + math.subset(arr, math.index(i))) / 3.0;

	}


}

function setQColors(arr) {
	
	for (i = 0; i < 60; i++) {
		document.getElementById("q" + i).style.opacity = (1.5 + math.subset(arr, math.index(i))) / 3.0;

	}


}

function parse_digits_helper(digit_seq, tree_so_far) {
	if (digit_seq.length == 1) {
		var new_tree = tree_so_far.slice();
     		new_tree.push([[0]]);
     		return new_tree;
     	} else {
     		document.getElementById("displaydiv").innerHTML = "in helper";
     		var min_rep = 100;
     		var index_of_min = -1;
     		
     		for (i = 0; i < digit_seq.length - 1; i++) {
     			document.getElementById("displaydiv").innerHTML = "in helper 2first " + i + digit_seq[i];
			var rep = digit_seq[i];
     			document.getElementById("displaydiv").innerHTML = "in helper 2prev " + rep;
     			if (rep < min_rep) {
				min_rep = rep;
     				index_of_min = i;
     			}
     		}
     		document.getElementById("displaydiv").innerHTML = "in helper 2next";

     		var start_vec = []
     		for (i = 0; i < digit_seq.length; i++) {
     			start_vec.push(i);
     		}
		var new_vec = start_vec.slice(0,index_of_min);
     		new_vec.push([index_of_min, index_of_min + 1]);
     		new_vec = new_vec.concat(start_vec.slice(index_of_min + 2));
		var first_arg_start = digit_seq.slice(0, index_of_min);
		var first_arg_end = digit_seq.slice(index_of_min + 1);
     		var first_arg = first_arg_start.concat(first_arg_end);

     		var second_arg = tree_so_far.concat([new_vec]);
		return parse_digits_helper(first_arg, second_arg);
     	}

     	var start_seq = parse_digits_helper(digit_seq, tree_so_far);
	document.getElementById("displaydiv").innerHTML = start_seq + "huh";
     	
     	var new_seq = [];

	for (i = 0; i < start_seq.length; i++) {
		var new_elt = [];
     		document.getElementById("displaydiv").innerHTML = "after huh " + start_seq[i];
     		for (j = 0; j < start_seq[i].length; j++) {
     			document.getElementById("displaydiv").innerHTML = "after after huh ";
			var inner_elt = start_seq[i][j];
     			document.getElementById("displaydiv").innerHTML = "after after huh " + Array.isArray(inner_elt);
     			if (Array.isArray(inner_elt)) {
				new_elt.push(inner_elt);

				new_elt.push([inner_elt]);
     			}

     		}
		new_seq.push(new_elt);
     	}

	document.getElementById("displaydiv").innerHTML = "through the for loop";

	return new_seq;
     }

     function get_tree_roles(tree_rep) {

     	document.getElementById("displaydiv").innerHTML = tree_rep;
	if (tree_rep == [[[0]]]) {
		return [tree_roles_dict["L"]];
     	}

     	var current_list = ["L", "R"];
	var this_list = tree_rep.slice(0, -2);

     	this_list.reverse();
	document.getElementById("displaydiv").innerHTML = this_list + " is this list";
     	for (i = 0; i < this_list.length; i++){
		var next_list = [];
     		var item = this_list[i];

     		for (j = 0; j < item.length; j++) {
			var elt = item[j];
     			if (elt.length == 1) {
				next_list.push(current_list[j]);
     			} else {
				next_list.push(current_list[j] + "L");
     				next_list.push(current_list[j] + "R");
     			}
     		}
     		current_list = next_list;
     	}
     	var final_list = [];
     	for (k = 0; k < current_list.length; k++) {
		final_list.push(tree_roles_dict[current_list[k]]);
     	}

	return final_list;
     }
